import React from "react";
import './Feed.css';
import Webcam from 'react-webcam';

class Feed extends React.Component {
    
    videoConstraints = {
    width: 300,
    height: 300,
    facingMode: "user",
  };

  
    render() {
        return (
            <div>
                < Webcam videoConstraints = {videoConstraints}/>
                <div>
                    Instructions:
                    <li>1</li>
                    <li>1</li>
                    <li>1</li>
                </div>
            </div>
           
        );
    }
}

export default Feed;
